import Jumbotron from 'react-bootstrap/Jumbotron'
import Button from 'react-bootstrap/Button'
import Video from "./Video"
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools</p3>
          </h1>
          <video src={video} autoPlay="true" />
          </Jumbotron>
      </header>
    </div>

  );
}

export default App;
